geregisseerd door Joost van der Valk en Mags Gavan
met Geert Wilders

Geert Wilders weet zowel nationaal als internationaal discussie, woede en bewondering op te wekken. Tijdens de laatste verkiezingen (juni 2010) was zijn Partij voor de Vrijheid (PVV) de grote winnaar. Filmmakers Joost van der Valk en Mags Gavan raakten gefascineerd: wie is Geert Wilders, wie zijn de mensen die op hem stemmen en hoe komt het dat hij zo succesvol is? In &quot;Wilders, the Movie&quot; onderzoeken de filmmakers de drijfveren van Wilders en zijn aanhang.

